import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
    return (
        <div>
            <label class={"label"} for={"name"}>
                Enter your Name:
            </label>
            <input id={"name"} type={"text"}/>
            <button style={{"backgroundColor": 'blue', "color": "'white'"}}> Submit </button>
        </div>
    )
};

ReactDOM.render(
    <App />,
    document.querySelector('#root')
);
